        order: [["createdAt", "ASC"]],
        attributes: {},
        include: [
          { model: db.Allcodes, as: "stockData", attributes: ["valueVi"] },
        ],
        raw: true,
        nest: true,
      });

      resolve({
        errCode: 0,
        data: products,
