import db from "../models/index";
const cart = null;
let checkProductName = (productName) => {
  return new Promise(async (resolve, reject) => {
    try {
      let product = await db.Products.findOne({
        where: { name: productName },
      });
      if (product) {
        resolve(true);
      } else {
        resolve(false);
      }
    } catch (e) {
      reject(e);
    }
  });
};

let getAllProducts = (productId) => {
  return new Promise(async (resolve, reject) => {
    try {
      let products = "";
      if (productId === "ALL") {
        products = await db.Products.findAll();
      }
      if (productId && productId !== "ALL") {
        products = await db.Products.findOne({
          where: { id: productId },
        });
      }
      resolve(products);
    } catch (e) {
      reject(e);
    }
  });
};

let createNewProduct = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      // check name is exist
      let check = await checkProductName(data.name);
      if (check === true) {
        resolve({
          errCode: 1,
          errMessage:
            "Your product name is already in use. Please try another name",
        });
      } else {
        await db.Products.create({
          name: data.name,
          price: data.price,
          discount: data.discount,
          describe: data.describe,
          stockId: data.stockId,
          image: data.image,
          secondImage: data.secondImage,
          thirdImage: data.thirdImage,
          type: data.type,
        });
      }
      resolve({
        errCode: 0,
        message: "OK",
      });
    } catch (e) {
      reject(e);
    }
  });
};

let deleteProduct = (productId) => {
  return new Promise(async (resolve, reject) => {
    let foundProduct = await db.Products.findOne({
      where: { id: productId },
      // include: [
      //   {
      //     model: db.Markdowns,
      //     attributes: ["contentHTML", "contentMarkdown"],
      //   },
      // ],
    });
    if (!foundProduct) {
      resolve({
        errCode: 2,
        errMessage: `The Product isn't exist`,
      });
    }
    await db.Products.destroy({
      where: { id: productId },
    });
    // await db.Markdowns.destroy({
    //   where: { id: foundProduct.Product.id },
    // });

    // if (foundProduct.Markdowns) {
    //   await foundProduct.Markdown.destroy();
    // }

    resolve({
      errCode: 0,
      errMessage: `The Product is deleted`,
    });
  });
};

let updateProduct = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!data.id || !data.stockId) {
        resolve({
          errCode: 2,
          errMessage: "Missing require parameter",
        });
      }

      let product = await db.Products.findOne({
        where: { id: data.id },
        raw: false,
      });

      if (product) {
        product.name = data.name;
        product.price = data.price;
        product.discount = data.discount;
        product.describe = data.describe;
        product.stockId = data.stockId;
        product.image = data.image;
        product.secondImage = data.secondImage;
        product.thirdImage = data.thirdImage;
        product.type = data.type;

        await product.save();

        resolve({
          errCode: 0,
          message: "Update product success",
        });
      } else {
        resolve({
          errCode: 1,
          message: "Product not exist",
        });
      }
    } catch (e) {
      reject(e);
    }
  });
};

let getAllCodesService = (typeInput) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!typeInput) {
        resolve({
          errCode: 1,
          errMessage: "Missing required parameters",
        });
      } else {
        let res = {};
        let allcode = await db.Allcodes.findAll({
          where: { type: typeInput },
        });
        res.errCode = 0;
        res.data = allcode;
        resolve(res);
      }
    } catch (e) {
      reject(e);
    }
  });
};

let getRollPaperHome = (limitInput) => {
  return new Promise(async (resolve, reject) => {
    try {
      let products = await db.Products.findAll({
        limit: limitInput,
        where: { type: ["cuộn", "cuộn nhiệt"] },
        order: [["createdAt", "ASC"]],
        attributes: {},
        include: [
          { model: db.Allcodes, as: "stockData", attributes: ["valueVi"] },
        ],
        raw: true,
        nest: true,
      });

      resolve({
        errCode: 0,
        data: products,
