sourcesContent:
import db from "../models/index";
const { Op } = require('sequelize');
require("dotenv").config();

let getOrder = (orderId) => {
  return new Promise(async (resolve, reject) => {
    try {
      let orders = "";
      if (orderId === "ALL") {
        orders = await db.Orders.findAll({});
      }
      if (orderId && orderId !== "ALL") {
        orders = await db.Orders.findOne({
          where: { id: orderId },
        });
      }
      resolve(orders);
    } catch (e) {
      reject(e);
    }
  });
};

let deleteOrder = (orderInfo) => {
  return new Promise(async (resolve, reject) => {
    try {
      let deleteOrder = await db.Orders.findOne({ where: { id: orderInfo.id } });
      if (!deleteOrder) {
        resolve({
          errCode: 2,
          errMessage: `The Product isn't exist`,
        });
      }
      await db.Orders.destroy({
        where: { id: orderInfo.id },
      });
      resolve({
        errCode: 0,
      });
    }
    catch (e) {
      reject(e)
    }
  })
}

let editOrder = (data) => {
  return new Promise(async (resolve, reject) => {
    try {

    }
    catch (e) {
      reject(e)
    }
  })
}

let getOrderByNumber = (orderNum) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!orderNum) {
        resolve({
          errCode: 1,
          errMessage: "Mising required parameter",
        });
      } else {
        let data = await db.DetailOrders.findAll({
          where: {
            orderNumber: orderNum,
          },
          // attributes: {
          //     exclude: ['']
          // },
          include: [],
          raw: false,
          nest: true,
        });

        if (!data) data = {};

        resolve({
          errCode: 0,
          data: data,
        });
      }
    } catch (e) {
      reject(e);
    }
  });
};

let getUserByOrderNumber = (orderNumber) => {
  return new Promise(async (resolve, reject) => {
    try {
      let user = await db.Users.findOne({
        where: {
          orderNumber: {
            [Op.contains]: [orderNumber]
          }
        }
      })
      if (user) {
        console.log("Value found in array attribute");
      } else {
        console.log("Value not found in array attribute");
      }
      resolve({
        errCode: 0,
        errMessage: "OK",
        user
      })
    }
    catch (e) {
      reject(e);
    }
  })
}

module.exports = {
  getOrder: getOrder,
  getOrderByNumber: getOrderByNumber,
  deleteOrder: deleteOrder,
  editOrder: editOrder,
  getUserByOrderNumber: getUserByOrderNumber,
};

